import React, { Component } from "react";
import "./styles.scss";
import DetailNav from "./DetailNav";

class ProductDetail extends Component {
  render() {
    return (
      <div className="container-fluid p-0" id="detail-product">
        <DetailNav />
      </div>
    );
  }
}

export default ProductDetail;
